                            { name: 'Maharsa Aradhya', status: 'Ready to Move', price: 'â‚¹ 65 Lacs', img: 'building1.jpg' },
                            { name: 'Vignaharta Enclave', status: 'New Launch', price: 'â‚¹ 75 Lacs', img: 'building2.jpg' },
